async function searchZipcode(value) {
    try {
        const response = await fetch('https://viacep.com.br/ws/' + value + '/json', {
            method: "GET"
        });

        const responseData = await response.json();

        return { data: responseData };
    } catch (error) {
        return error.message
    }
}

export {
    searchZipcode
}
